INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('3095c632-6608-438d-b729-691024fd0515', '73ad9167ebf310aad51ae9804977df8b', 0, 'Bipolar Disorders Learn about bipolar disorder, including symptoms, risk factors, treatment options and answers to your questions. Bipolar disorders are mental health conditions characterized by periodic, intense emotional states affecting a person''s mood, energy, and ability to function. These periods, lasting from days to weeks, are called mood episodes. Mood episodes are categorized as manic/hypomanic episodes when the predominant mood is intensely happy or irritable, or depressive episodes when there is an intensely sad mood or the ability to experience joy or pleasure disappears. People with bipolar disorder generally have periods of neutral mood as well. When treated, people with bipolar disorder can lead full and productive lives.', '[0.2604140639305115,-0.20061150193214417,0.7193657755851746,-0.09895923733711243,0.21584485471248627,0.5325211882591248,-0.06709621101617813,-0.3286833167076111,0.04251103103160858,-0.3483586311340332,0.15884296596050262,-0.1817733198404312,-0.29989194869995117,0.006137071643024683,-0.1777399629354477,0.8865926265716553,0.2338932305574417,0.3759356737136841,-0.2596874237060547,-0.6174461245536804,0.017705444246530533,0.0919426903128624,0.013988818973302841,-0.7283213138580322,0.014936557039618492,0.37073004245758057,-0.6400429606437683,-0.9327892065048218,-0.6154477596282959,0.14921404421329498,-0.73987877368927,0.005813756957650185,-0.21273177862167358,0.5067252516746521,-0.06020446494221687,-0.5971832275390625,0.30853644013404846,1.57927405834198,0.49200406670570374,0.4527512192726135,-0.30441489815711975,-0.20801454782485962,-0.220513254404068,0.14815068244934082,0.43741241097450256,-0.1839788854122162,-0.3290814459323883,0.464129775762558,0.9808480143547058,0.17776983976364136,0.3617245852947235,-0.3303573429584503,0.1588825136423111,0.594